import { Link } from 'react-router-dom';

const Browse = ({ movies }) => {
  return (
    <div className="movies-list">
      {movies.map(movie => (
        <div className="movie-preview" key={movie.id} >
          <Link to={`/movie/${movie.id}`}>
            <h2>{ movie.name }</h2>
          </Link>

          <p>{ movie.Description }</p>
          <img src="./img/the-god-father.png" />
        </div>
      ))}
    </div>
  );
}

export default Browse;
